        case(undefined):
        break;

        default:
            if(props.activate.state === true){    
                return <React.Fragment>

                <Delete_popup_container
                    
                    activate={props.activate.state}
                >
                    <div>
                        <span>Are you sure you want to delete this review?</span>
                    </div>
                </Delete_popup_container>

                </React.Fragment>}
